// Divide returns w÷x.
func Divide(w, x V) V {
	switch w := w.(type) {
	case B:
		return DivideBV(w, x)
	case F:
		return DivideFV(w, x)
	case I:
		return DivideIV(w, x)
	case AB:
		return DivideABV(w, x)
	case AF:
		return DivideAFV(w, x)
	case AI:
		return DivideAIV(w, x)
	case AV:
		switch x := x.(type) {
		case Array:
			if x.Len() != len(w) {
				return badlen("÷")
			}
			r := make(AV, len(w))
			for i := range r {
				v := Divide(w[i], x.At(i))
				e, ok := v.(E)
				if ok {
					return e
				}
				r[i] = v
			}
			return r
		}
		r := make(AV, len(w))
		for i := range r {
			v := Divide(w[i], x)
			e, ok := v.(E)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	case E:
		return w
	default:
		return badtype("÷")
	}
}

