func MinimumBV(w B, x V) V {
	switch x := x.(type) {
	case B:
		return B(w && x)
	case F:
		return F(F(math.Min(float64(B2F(w)), float64(x))))
	case I:
		return I(minI(B2I(w), x))
	case AB:
		r := make(AB, len(x))
		for i := range r {
			r[i] = bool(B(w) && B(x[i]))
		}
		return r
	case AF:
		r := make(AF, len(x))
		for i := range r {
			r[i] = float64(F(math.Min(float64(B2F(B(w))), float64(F(x[i])))))
		}
		return r
	case AI:
		r := make(AI, len(x))
		for i := range r {
			r[i] = int(minI(B2I(B(w)), I(x[i])))
		}
		return r
	case AV:
		r := make(AV, len(x))
		for i := range r {
			v := MinimumBV(B(w), x[i])
			e, ok := v.(E)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	case E:
		return w
	default:
		return badtype("⌊")
	}
}

