// Maximum returns w⌈x.
func Maximum(w, x V) V {
	switch w := w.(type) {
	case B:
		return MaximumBV(w, x)
	case F:
		return MaximumFV(w, x)
	case I:
		return MaximumIV(w, x)
	case S:
		return MaximumSV(w, x)
	case AB:
		return MaximumABV(w, x)
	case AF:
		return MaximumAFV(w, x)
	case AI:
		return MaximumAIV(w, x)
	case AS:
		return MaximumASV(w, x)
	case AV:
		switch x := x.(type) {
		case Array:
			if x.Len() != len(w) {
				return badlen("⌈")
			}
			r := make(AV, len(w))
			for i := range r {
				v := Maximum(w[i], x.At(i))
				e, ok := v.(E)
				if ok {
					return e
				}
				r[i] = v
			}
			return r
		}
		r := make(AV, len(w))
		for i := range r {
			v := Maximum(w[i], x)
			e, ok := v.(E)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	case E:
		return w
	default:
		return badtype("⌈")
	}
}

