// Modulus returns w|x.
func Modulus(w, x V) V {
	switch w := w.(type) {
	case B:
		return ModulusBV(w, x)
	case F:
		return ModulusFV(w, x)
	case I:
		return ModulusIV(w, x)
	case AB:
		return ModulusABV(w, x)
	case AF:
		return ModulusAFV(w, x)
	case AI:
		return ModulusAIV(w, x)
	case AV:
		switch x := x.(type) {
		case Array:
			if x.Len() != len(w) {
				return badlen("|")
			}
			r := make(AV, len(w))
			for i := range r {
				v := Modulus(w[i], x.At(i))
				e, ok := v.(E)
				if ok {
					return e
				}
				r[i] = v
			}
			return r
		}
		r := make(AV, len(w))
		for i := range r {
			v := Modulus(w[i], x)
			e, ok := v.(E)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	case E:
		return w
	default:
		return badtype("|")
	}
}

